import{_ as e,c as a,o as r,ag as n}from"./chunks/framework.CRdwa1pV.js";const o="/gmonad.cc/blog/monad_testnet_important_projects_1.png",p="/gmonad.cc/blog/monad_testnet_important_projects_2.png",s="/gmonad.cc/blog/monad_testnet_important_projects_3.png",m="/gmonad.cc/blog/monad_testnet_important_projects_4.png",_="/gmonad.cc/blog/monad_testnet_important_projects_5.png",i="/gmonad.cc/blog/monad_testnet_important_projects_6.png",l="/gmonad.cc/blog/monad_testnet_important_projects_7.png",c="/gmonad.cc/blog/monad_testnet_important_projects_8.png",d="/gmonad.cc/blog/monad_testnet_important_projects_9.png",z=JSON.parse('{"title":"Monad 测试网你应该关注的生态项目","description":"Monad 测试网你应该关注的生态项目","frontmatter":{"title":"Monad 测试网你应该关注的生态项目","description":"Monad 测试网你应该关注的生态项目","image":"/blog/monad_testnet_important_projects_title.png"},"headers":[],"relativePath":"blog/monad_testnet_important_projects.md","filePath":"blog/monad_testnet_important_projects.md"}'),h={name:"blog/monad_testnet_important_projects.md"};function f(g,t,b,k,u,x){return r(),a("div",null,t[0]||(t[0]=[n('<h1 id="monad-测试网你应该关注的生态项目" tabindex="-1">Monad 测试网你应该关注的生态项目 <a class="header-anchor" href="#monad-测试网你应该关注的生态项目" aria-label="Permalink to &quot;Monad 测试网你应该关注的生态项目&quot;">​</a></h1><div class="tip custom-block"><p class="custom-block-title">原文</p><p><a href="https://x.com/0x_xifeng/status/1916326459599425622" target="_blank" rel="noreferrer">https://x.com/0x_xifeng/status/1916326459599425622</a></p></div><p>Monad测试网已经进行了一段时间了，大家应该都体验了不少生态项目了吧？</p><p>我猜大家估计都是看的Monad测试官网展示出来的75个项目，但其实生态项目并不止这些，我稍后把另外一个网址贴出来，然后说一说我认为测试网期间可以体验的生态项目。</p><p>ecosystem：<a href="https://www.monad.xyz/ecosystem" target="_blank" rel="noreferrer">https://www.monad.xyz/ecosystem</a></p><h2 id="一、nad-fun" tabindex="-1">一、<a href="https://nad.fun/" target="_blank" rel="noreferrer">Nad.fun</a> <a class="header-anchor" href="#一、nad-fun" aria-label="Permalink to &quot;一、[Nad.fun](https://nad.fun/)&quot;">​</a></h2><p><a href="https://x.com/@naddotfun" target="_blank" rel="noreferrer">@naddotfun</a> 介绍下，这是个meme币发射台，简单的说就是Monad版本的pumpfun，这么一说就都明白了吧？</p><p>大家可以在这上边PVP，发行自己的meme币，然后在测试网期间，还有测试网活动可以参加，通过交易meme币拿积分。</p><p>为什么说这个平台呢，因为Monad社区本身就是靠meme文化出名的，三大吉祥物应该都在知道吧，molandak、chog、moyaki，届时主网上线，在这里一定会有金狗出现，并且大概率就是吉祥物的二创作品。</p><p><a href="https://testnet.nad.fun/rewards" target="_blank" rel="noreferrer">https://testnet.nad.fun/rewards</a></p><p><img src="'+o+'" alt="monad_testnet_important_projects_1"></p><h2 id="二、rarebetsports" tabindex="-1">二、rarebetsports <a class="header-anchor" href="#二、rarebetsports" aria-label="Permalink to &quot;二、rarebetsports&quot;">​</a></h2><p><a href="https://x.com/@RareBetSports" target="_blank" rel="noreferrer">@RareBetSports</a> 这是个体育博彩项目，简单些，赌球的，当然也有其他的体育竞技，比如csgo，但目前测试网仅开放了篮球和棒球。</p><p>我认为平时喜欢体育竞技的，爱没事买一买大球小球的，可以玩一玩这个，目前每周都会有一个RareLink Prize，万一下一个中奖的就是你呢？</p><p><a href="https://rarelink.rarebetsports.io/" target="_blank" rel="noreferrer">https://rarelink.rarebetsports.io/</a></p><p><img src="'+p+'" alt="monad_testnet_important_projects_2"></p><h2 id="三、kuru-dex" tabindex="-1">三、kuru dex <a class="header-anchor" href="#三、kuru-dex" aria-label="Permalink to &quot;三、kuru dex&quot;">​</a></h2><p><a href="https://x.com/@KuruExchange" target="_blank" rel="noreferrer">@KuruExchange</a> 这是个dex，目前分为pro和lite两个入口，pro就是订单薄形式，账户托管的形式，你需要将测试币发送到dex内置的地址才可以进行交易，lite就是uniswap类型，直接连接钱包就可以进行swap。</p><p>目前来看，这个dex的社区氛围最好，而且也是在Monad测试官网的特色应用那里展示了出来，也是目前测试网用户经常使用的dex之一，我猜测，在主网阶段，kuru可能会是原生的dex龙头。</p><p><a href="https://www.kuru.io/markets?marketType=trending&amp;timeInterval=5m" target="_blank" rel="noreferrer">https://www.kuru.io/markets?marketType=trending&amp;timeInterval=5m</a></p><p><img src="'+s+'" alt="monad_testnet_important_projects_3"></p><h2 id="四、kizzy" tabindex="-1">四、kizzy <a class="header-anchor" href="#四、kizzy" aria-label="Permalink to &quot;四、kizzy&quot;">​</a></h2><p><a href="https://x.com/@kizzymobile" target="_blank" rel="noreferrer">@kizzymobile</a> 这是个社交预测市场，在这里，我们可以对一些社交内容数据进行下注，举个例子，keone发了一条帖子，我们就可以预测，这条帖子在24小时后能否达到100万的浏览量，选择是或不是；也可以预测keone推特账号粉丝的24小时变化情况，比如24小时后和现在比，账号的粉丝数量的变化情况是大于100个还是少于100个。</p><p>预计可能会和polymarket一样，上边很多送钱机会，只不过收益不是很夸张罢了。</p><p><a href="https://kizzy.io/" target="_blank" rel="noreferrer">https://kizzy.io/</a></p><p><img src="'+m+'" alt="monad_testnet_important_projects_4"></p><h2 id="五、curvance" tabindex="-1">五、Curvance <a class="header-anchor" href="#五、curvance" aria-label="Permalink to &quot;五、Curvance&quot;">​</a></h2><p><a href="https://x.com/@Curvance" target="_blank" rel="noreferrer">@Curvance</a> 这是个借贷市场，也是目前为止，我在monad测试网上看到的最好的一个借贷项目了，目前支持很多条链，相信会在Monad主网占有一席之地。</p><p><a href="https://monad.curvance.com/" target="_blank" rel="noreferrer">https://monad.curvance.com/</a></p><p><img src="'+_+'" alt="monad_testnet_important_projects_5"></p><h2 id="六、magiceden" tabindex="-1">六、magiceden <a class="header-anchor" href="#六、magiceden" aria-label="Permalink to &quot;六、magiceden&quot;">​</a></h2><p><a href="https://x.com/@MagicEden" target="_blank" rel="noreferrer">@MagicEden</a> 想不关注也得关注，因为在Monad测试网上线到现在，这是最大的NFT市场，届时主网上线，根据用户的使用习惯，也一定会选择magiceden，所以关注这个项目，没问题吧？</p><p>其他的NFT市场也可以关注关注，可能会在主网期间，两个NFT市场之间存在一些差价，这里推荐 <a href="https://x.com/@poply_xyz" target="_blank" rel="noreferrer">@poply_xyz</a></p><p><a href="https://magiceden.io/monad-testnet" target="_blank" rel="noreferrer">https://magiceden.io/monad-testnet</a></p><p><img src="'+i+'" alt="monad_testnet_important_projects_6"></p><h2 id="七、apriori-fastlane" tabindex="-1">七、aPriori &amp; fastlane <a class="header-anchor" href="#七、apriori-fastlane" aria-label="Permalink to &quot;七、aPriori &amp; fastlane&quot;">​</a></h2><p><a href="https://x.com/@apr_labs" target="_blank" rel="noreferrer">@apr_labs</a> <a href="https://x.com/@apr_labs" target="_blank" rel="noreferrer">@0xFastLane</a> 将这两个放一起吧，两者都是MEV + Defi，融资的话，前者融资1070万+YZi labs战略投资，后者则是830万美金的融资。从热度上来说，前者aPriori的热度更高一些，后者则稍差一些，但这不能成为我们完全忽略fastlane的原因。</p><p>两者应该都会有不错的表现，需要等待主网再一分高下了，目前两者测试网都可以质押MON代币，感兴趣的去体验下。</p><p><a href="https://stake.apr.io/" target="_blank" rel="noreferrer">https://stake.apr.io/</a></p><p><a href="https://shmonad.xyz/" target="_blank" rel="noreferrer">https://shmonad.xyz/</a></p><p><img src="'+l+'" alt="monad_testnet_important_projects_7"></p><p><img src="'+c+'" alt="monad_testnet_important_projects_8"></p><h2 id="八、fantasy" tabindex="-1">八、fantasy <a class="header-anchor" href="#八、fantasy" aria-label="Permalink to &quot;八、fantasy&quot;">​</a></h2><p><a href="https://x.com/@fantasy_top_" target="_blank" rel="noreferrer">@fantasy_top_</a> 不用过多介绍了吧，卡牌游戏，测试网上线第一天好多人应该都玩了吧，很火的项目。</p><p>目前玩这个游戏去参加里面的竞赛，可以获得抽奖券，然后抽NFT白名单，别错过，好多人都已经拿到了不少白名单了。</p><p><a href="https://monad.fantasy.top/login" target="_blank" rel="noreferrer">https://monad.fantasy.top/login</a></p><p><img src="'+d+'" alt="monad_testnet_important_projects_9"></p><h2 id="结尾" tabindex="-1">结尾 <a class="header-anchor" href="#结尾" aria-label="Permalink to &quot;结尾&quot;">​</a></h2><p>目前先说这么多吧，测试网才上线两个多月，大家应该也都有了自己心目中的那个主网龙头项目，但也不能完全咬定，因为还有其他项目并未上线，万一出现黑马呢？ 比如 <a href="https://x.com/@perpltrade" target="_blank" rel="noreferrer">@perpltrade</a> <a href="https://x.com/@narrativexyz" target="_blank" rel="noreferrer">@narrativexyz</a> <a href="https://x.com/@CompositeLabs" target="_blank" rel="noreferrer">@CompositeLabs</a> 。</p>',49)]))}const j=e(h,[["render",f]]);export{z as __pageData,j as default};
